	public VoxelShape toVoxelShape() {
		List<VoxelShape> shapes = new ArrayList<VoxelShape>();
		VoxelShape[] shapeList;
		for (double[] vox : this.getBoundingBoxes()) {
			shapes.add(Block.makeCuboidShape(16 - vox[0], vox[1], 16 - vox[2], 16 - vox[3], vox[4], 16 - vox[5]));
		}
		shapeList = (VoxelShape[]) shapes.toArray(new VoxelShape[shapes.size()]);
		return Arrays.stream(Arrays.copyOfRange(shapeList, 1, shapeList.length)).reduce(shapeList[0], VoxelShapes::or);
	}
	
